import React from 'react';
import { NavLink } from 'react-router-dom';

const Navbar: React.FC = () => {
  return (
    <nav style={{ padding: '1rem', background: '#f9fafb', borderBottom: '1px solid #ddd' }}>
      <NavLink to="/" style={{ marginRight: '16px', color: '#f472b6' }}>
        Summary
      </NavLink>
      <NavLink to="/momentum" style={{ marginRight: '16px', color: '#2563eb' }}>
        MomentumEdge
      </NavLink>
      <NavLink to="/trend" style={{ marginRight: '16px', color: '#16a34a' }}>
        TrendEdge
      </NavLink>
      <NavLink to="/warrior" style={{ marginRight: '16px', color: '#dc2626' }}>
        WarriorEdge
      </NavLink>
      <NavLink to="/tracker" style={{ marginRight: '16px', color: '#9333ea' }}>
        ICC Tracker
      </NavLink>
      <NavLink to="/icc" style={{ marginRight: '16px', color: '#f59e0b' }}>
        ICC Page
      </NavLink>
      <NavLink to="/test" style={{ color: '#0d9488' }}>
        Test Harness
      </NavLink>
    </nav>
  );
};

export default Navbar;
